import React from "react";
import styled from "styled-components";

function Nav() {
  return (
    <NavContainer>
      <LogoContainer>
        <h1>Logo</h1>
      </LogoContainer>
      <MenuItemsContainer>
        <nav>
          <ul>Item 1</ul>
          <ul>Item 2</ul>
          <ul>Item 3</ul>
        </nav>
      </MenuItemsContainer>
    </NavContainer>
  );
}

export default Nav;

const NavContainer = styled.div`
  position: relative;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
`;

const LogoContainer = styled.div`
  position: relative;
`;

